INSERT INTO `client_testimonials` (`id`, `created`, `name`, `designation`, `star`, `description`, `avatar`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1, '2024-03-12', 'Specific Image', 'Get a specific image', '3.7', '<p><strong style=\"margin: 0px; padding: 0px; font-family: \" open=\"\" sans\",=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" text-align:=\"\" justify;\"=\"\">Lorem Ipsum</strong><span style=\"font-family: \" open=\"\" sans\",=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" text-align:=\"\" justify;\"=\"\"> is slechts een proeftekst uit het drukkerij- en zetterijwezen. Lorem Ipsum is de standaard proeftekst in deze bedrijfstak sinds de 16e eeuw, toen een onbekende drukker een zethaak met letters nam en ze door elkaar husselde om een font-catalogus te maken.</span><br></p>', 'public/uploads/client-testimonial/userdemo03-2401237972-2403121190.webp', NULL, '2024-01-23 02:30:13', '2024-03-12 04:19:54'),
(2, '2024-01-23', 'Melanie L.', 'Customer service agent', '2.6', '<p>Unsecured loans are monetary loans that are not secured against the borrower\'s assets.<br></p>', 'public/uploads/client-testimonial/userdemo02-2401232499.webp', NULL, '2024-01-23 04:27:45', '2024-01-23 04:41:06'),
(3, '2024-01-23', 'Louis jabeth', 'Customer service agent', '4.8', '<p>Interest rates on unsecured loans are nearly always higher than for secured loans.<br></p>', 'public/uploads/client-testimonial/userdemo01-2401234255.webp', NULL, '2024-01-23 04:28:58', '2024-01-23 04:41:00'),
(4, '2024-01-23', 'Robin Doe', 'Customer service agent', '1.8', '<p>A concessional loan, sometimes called a \"soft loan\", is granted on terms substantially.<br></p>', 'public/uploads/client-testimonial/userdemo-2401234879.webp', NULL, '2024-01-23 04:30:09', '2024-01-23 04:40:53'),
(6, '2024-11-14', 'Maggie Acevedo', 'Illo aut eos id qui', '5', 'Ad sunt ducimus, qui.', NULL, '2024-11-14 03:27:02', '2024-11-14 03:25:35', '2024-11-14 03:27:02'),
(7, '2024-11-14', 'Eric Grimes', 'Id dolore voluptate', '3', NULL, NULL, '2024-11-14 03:45:20', '2024-11-14 03:43:17', '2024-11-14 03:45:20');
