INSERT INTO `email_templates` (`id`, `name`, `subject`, `description`, `position`, `status`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1, 'Invoice', 'Payment Invoice', '<div data-v-ddf05e88=\"\" class=\"v-card__text\"><p>Hello Dear client,</p><p>Your articles have been published successfully and delivered to you. Your total bill is $[Total Bill].</p><p><strong>Click the invoice link and pay your due bill:</strong></p>[Invoice Link]</div>', 1, 1, NULL, '2024-02-22 05:02:38', '2024-07-18 00:15:40'),
(2, 'Warning Invoice', 'Payment Reminder Invoice', '<div data-v-ddf05e88=\"\" class=\"v-card__text\"><p>Hello Dear client,</p><p>Your articles have been published successfully and delivered to you. Your total bill is $[Total Bill].</p><p>We Informed you many times, but you didn\'t pay. So that\'s why we decided to remove due posts or link insertion. </p><p><strong style=\"color: rgb(230, 0, 0);\">If you don\'t pay within 2 days then your due post will be deleted permantley.</strong></p><p><strong style=\"color: rgb(230, 0, 0);\">Once you paid then must be inform us to re publish your article again.</strong></p><p><strong>Click the invoice link and pay your due bill:</strong></p><p><strong><br></strong></p>[Invoice Link]\r\n            </div>', 2, 1, NULL, '2024-03-05 03:51:31', '2024-03-18 02:51:10'),
(3, 'Remove Invoice', 'Remove Post', '<p>Hello Dear Clients,</p><p>Your articles have been published successfully and delivered to you. your total bill is $[Total Bill]. we already notified many times for payment, but you didn\'t pay yet, that\'s why we removed your all due posts or links.</p><p><strong style=\"color: rgb(230, 0, 0);\">When you pay invoice then Re-publish your article automatically. </strong></p><p><strong>Here is the due invoice link:&nbsp;</strong></p><p><strong><br></strong>[Invoice Link]</p><p><br></p><p><strong>Below is your deleted post links:</strong></p><p>[Post Link]</p>', 4, 1, NULL, '2024-03-05 03:58:29', '2024-03-21 04:32:51'),
(4, 'News letters', 'News letters', '<meta http-equiv=\"X-UA-Compatible\" content=\"ie=edge\">\r\n<meta http-equiv=\"Content-Type\" content=\"text/html;charset=UTF-8\">\r\n<meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\r\n<title>Guestpostcc email template</title>\r\n<style type=\"text/css\">\r\n  @import url(\"https://fonts.googleapis.com/css2?family=Inter:wght@100..900&display=swap\");\r\n\r\n  body {\r\n    font-family: \"Inter\", sans-serif;\r\n    margin: 0;\r\n    background-color: #f7f7f8;\r\n    line-height: 1.8;\r\n    color: #333333;\r\n\r\n  }\r\n\r\n  #email-template-wrapper table {\r\n    border-spacing: 0;\r\n    width: 100%;\r\n    border-collapse: collapse;\r\n  }\r\n\r\n  #email-template-wrapper img {\r\n    border: 0;\r\n  }\r\n\r\n  #email-template-wrapper td {\r\n    border: 1px solid #fbdfc7a1 !important;\r\n    opacity: 0.8;\r\n    text-align: center;\r\n    padding: 10px;\r\n  }\r\n\r\n  #email-template-wrapper .website-list-table tbody tr:nth-child(even) {\r\n    background-color: #fbdfc752 !important;\r\n  }\r\n\r\n  #email-template-wrapper .website-link {\r\n    color: #3D3ACE !important;\r\n    font-weight: 500;\r\n    text-decoration: none;\r\n    font-size: 16px;\r\n  }\r\n\r\n  #email-template-wrapper .header {\r\n    background-color: white !important;\r\n  }\r\n\r\n  @media (prefers-color-scheme: dark) {\r\n    #email-template-wrapper .header {\r\n      background-color: white !important;\r\n    }\r\n  }\r\n\r\n  #email-template-wrapper .heading-two {\r\n    font-size: 24px;\r\n    margin-top: 12px;\r\n    line-height: 100%;\r\n    padding-bottom: 30px !important;\r\n    margin-bottom: 0;\r\n    font-weight: 500 !important;\r\n    color: #000;\r\n    border-bottom: 1px solid rgba(0, 0, 0, 0.1);\r\n  }\r\n\r\n  #email-template-wrapper .heading-three {\r\n    font-size: 24px;\r\n    color: #333333;\r\n    font-weight: 600 !important;\r\n\r\n  }\r\n\r\n  #email-template-wrapper .header-logo {\r\n    height: 43px;\r\n  }\r\n\r\n  #email-template-wrapper .message-section {\r\n    margin-bottom: 43px;\r\n    font-size: 16px;\r\n    opacity: 0.8;\r\n  }\r\n\r\n  #email-template-wrapper .social-link {\r\n    margin: 5px;\r\n    display: inline-block;\r\n    text-decoration: none;\r\n  }\r\n\r\n  #email-template-wrapper .click-here-btn {\r\n    display: block;\r\n    margin: auto;\r\n    padding: 10px 20px;\r\n    background-color: rgba(61, 187, 76, 1) !important;\r\n    color: white !important;\r\n    font-size: 18px;\r\n    font-weight: 500;\r\n    max-width: 654px;\r\n    text-decoration: none;\r\n    border-radius: 4px;\r\n  }\r\n\r\n  #email-template-wrapper .table-wrapper {\r\n    overflow: hidden;\r\n    border-radius: 2px;\r\n  }\r\n\r\n  #email-template-wrapper .footer-social a {\r\n    text-decoration: none !important;\r\n\r\n  }\r\n\r\n  @media screen and (max-width: 768px) {\r\n    #email-template-wrapper .header-logo {\r\n      height: 24px;\r\n    }\r\n\r\n    #email-template-wrapper .table-wrapper {\r\n      width: 100%;\r\n      overflow-x: scroll !important;\r\n\r\n    }\r\n\r\n    #email-template-wrapper .heading-three,\r\n    #email-template-wrapper .heading-two {\r\n      margin-top: 8px !important;\r\n      font-size: 16px !important;\r\n      font-weight: 500 !important;\r\n      line-height: 160% !important;\r\n    }\r\n\r\n    #email-template-wrapper td {\r\n      padding: 8px;\r\n    }\r\n\r\n    #email-template-wrapper .message-section {\r\n      margin-bottom: 20px;\r\n    }\r\n\r\n    #email-template-wrapper .click-here-btn {\r\n      font-size: 16px;\r\n      padding: 10px;\r\n      white-space: nowrap;\r\n    }\r\n\r\n    #email-template-wrapper .social-link {\r\n      margin: 6px;\r\n    }\r\n\r\n    /* .social-link img {\r\n      height: 20px !important;\r\n    } */\r\n\r\n    #email-template-wrapper .table-da,\r\n    #email-template-wrapper .table-niche {\r\n      display: none;\r\n    }\r\n  }\r\n</style>\r\n\r\n<div id=\"email-template-wrapper